import React, { useState, useEffect } from 'react'
import styled from 'styled-components'
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';



const Landing = () => {
  const [currentIndex, setCurrentIndex] = useState(0);
  const images = [
    'https://im.indiatimes.in/media/content/2018/Feb/_1518700069.jpg',
    'https://w.ndtvimg.com/sites/21/2015/10/30063740/Augmented-Reality-Applications-Helping-the-Blind-to-See.jpg',
    'https://pub.mdpi-res.com/sensors/sensors-22-08914/article_deploy/html/images/sensors-22-08914-g005.png?1668756145',
    'https://d3i71xaburhd42.cloudfront.net/4276c52caffea457787ce4d3e6504832beddc397/1-Figure1-1.png',
  ]; // Array of image URLs

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentIndex((prevIndex) => (prevIndex + 1) % images.length);
    }, 3000); // Change the delay time as needed (in milliseconds)

    return () => {
      clearInterval(interval);
    };
  }, [images.length]);

  return (
    <Container>
        <SlideOne>
          <div className="nav">
            <div className="logo">
              <div className="image"><img src="https://avatars.githubusercontent.com/u/100950301?s=280&v=4" alt="" /></div>
              <div className="text">
                <div className="product-name">Vision Bridge</div>
                <div className="team-name">Hackathon project by team SUWI</div>
              </div>
            </div>
          </div>
          <div className="main">
            <div className="text">
              <div className='product-name'>Vision Bridge</div>
              <h2>Helping to break down barriers for the visually impaired and create new opportunities for independence.</h2>
              <div className="btns">
                <div className="btn">Launch Product</div>
                <div className="btn">Family Member</div>
              </div>
            </div>
            <div className="image">
              <img src="https://im.indiatimes.in/media/content/2018/Feb/_1518700069.jpg" alt="" />
            </div>
          </div>
          <DancerDownIcon>
            <ExpandMoreIcon style={{ fontSize: '2rem', fill: '#333' }} />
          </DancerDownIcon>
        </SlideOne>
        <SliderWrapper>
          {images.map((url, index) => (
            <img
              key={index}
              src={url}
              alt={`Slider Image ${index}`}
              style={{ display: currentIndex === index ? 'block' : 'none' }}
              className='show-img'
            />
          ))}
          <SliderLine>
            <SliderProgress progress={((currentIndex + 1) / images.length) * 100} />
          </SliderLine>
        </SliderWrapper>
    </Container>
  )
}

export default Landing

const Container = styled.div`

`

const SlideOne = styled.div`
  width: 100vw;
  height: 100vh;
  /* background: #0B2447; */


  .nav{
    height: 70px;
    border-bottom: 1px solid black;
    display: flex;
    align-items: center;
    padding: 0 60px;

    .logo{
      display: flex;  
      align-items: center;

      .image{
        height: 50px;
        margin-right: 10px;
        img{
          height: 100%;
        }
      }

      .text{
        .product-name{
          font-size: 1.25rem;
          font-weight: 500;
        }

        .team-name{
          font-size: 0.75rem;
          font-weight: 300;
        }
      }
    }
  }

  .main{
    height: calc(100vh - 70px);
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding: 60px;

    .text{
      margin-right: 30px;
      display: flex;
      flex-direction: column;
      align-items: flex-start;

      .product-name{
        font-size: 1rem;
        /* background-color: #333; */
        /* color: white; */
        /* padding: 10px 15px; */
        letter-spacing: 0.1rem;
        margin-bottom: 10px;
      }

      h2{
        font-weight: 400;
        font-size: 1.75rem;
        letter-spacing: 0.1rem;
      }

      .btns{
        display: flex;

        .btn{
          font-size: 0.8rem;
          background-color: #333;
          color: white;
          padding: 10px 15px;
          letter-spacing: 0.1rem;
          margin-top: 60px;
          margin-right: 10px;
          cursor: pointer;
        }
      }


    }

    .image{
      img{
        width: calc(45vw - 30px);
      }
    }
  }
`

const DancerDownIcon = styled.div`
    position: absolute;
    bottom: 50px;
    width: 98%;
    display: grid;
    place-items: center;
    animation: animateDown infinite 1.5s;

    @keyframes animateDown{
        0%, 20%, 50%, 80%, 100%{
            transform: translateY(0);
        }
        40%{
            transform: translateY(5px);
        }
        60%{
            transform: translateY(3p);
        }
    }
    @media only screen and (max-width: 600px){
        bottom: 10px;
    }
`

const SliderWrapper = styled.div`
  position: relative;
  .show-img{
    width: 50vw;
    height: 300px;
  }
`;

const SliderLine = styled.div`
  position: absolute;
  bottom: 0;
  left: 0;
  right: 0;
  height: 5px;
  background-color: #ccc;
`;

const SliderProgress = styled.div`
  height: 100%;
  width: ${({ progress }) => progress}%;
  background-color: #ff0000;
`;
